-- ----------------------------
-- Table structure for sys_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` bigint(19) NOT NULL COMMENT '用户主键',
  `username` varchar(32) NOT NULL COMMENT '登录账户',
  `password` varchar(200) NOT NULL COMMENT '登录密码',
  `password_level` char(50) DEFAULT NULL COMMENT '登录密码强度',
  `enable` char(1) NOT NULL COMMENT '是否启用',
